        public Tuple<double, double, double, double, double> THD(double[] Sinal, double[] Tempo)
        {
            double magSUMT = 0;
            double magSUMP = 0;
            double magSUMI = 0;
            double magSUM3 = 0;
            double magFIRST = 0;

            Complex[] sinalFFT = new Complex[janela];

            for (int i = 0; i < janela; i++)
            {
                sinalFFT[i] = new Complex(Sinal[i], 0);
            }

            // Converte tempo para frequência
            Fourier.Forward(sinalFFT, FourierOptions.NoScaling);

            for (int i = 1; i < janela/10; i++)
            {
                double mag = (2.0 / janela) * (Math.Abs(Math.Sqrt(Math.Pow(sinalFFT[i].Real, 2) + Math.Pow(sinalFFT[i].Imaginary, 2))));
                //Determina quantos hertz
                double hzPeSample = freq / 3;

                if (mag > 0)
                {
                    if (hzPeSample * i > freq)
                    {
                        magSUMT = magSUMT + Math.Pow(mag, 2);
                        if (i % 2 == 0)
                        {
                            magSUMP = magSUMP + Math.Pow(mag, 2);
                        }
                        else
                        {
                            magSUMI = magSUMI + Math.Pow(mag, 2);
                        }
                        if (i % 9 == 0)
                        {
                            magSUM3 = magSUM3 + Math.Pow(mag, 2);
                        }
                    }
                }
                if (hzPeSample * i == 60)
                {
                    magFIRST = mag;
                }
            }
            return new Tuple<double, double, double, double, double>(magSUMT, magSUMP, magSUMI, magSUM3, magFIRST);
        }
        
