        private static double RMS(double[] vetor)
        {
            double sumQuad = 0;
            double resultado = 0;
            for (int i = 0; i < vetor.Length; i++)
            {
                sumQuad = sumQuad + Math.Pow(vetor[i], 2);
            }
            resultado = Math.Sqrt(sumQuad / vetor.Length);
            return resultado;
        }

        private static double FD(double[] vetor1, double [] vetor2, double [] vetor3)
        {
            vetor1 = selecaoFreq(vetor1);
            vetor2 = selecaoFreq(vetor2);
            vetor3 = selecaoFreq(vetor3);
            double VRMS1 = RMS(vetor1);
            double VRMS2 = RMS(vetor2);
            double VRMS3 = RMS(vetor3);

            double beta = (Math.Pow(VRMS1, 4) + Math.Pow(VRMS2, 4) + Math.Pow(VRMS3, 4))/Math.Pow((Math.Pow(VRMS1, 2) + Math.Pow(VRMS2, 2) + Math.Pow(VRMS3, 2)), 2);
            double resultado = Math.Sqrt((1 - Math.Sqrt(3 - (6 * beta))) / (1 + Math.Sqrt(3 - (6 * beta))));

            return resultado;
        }

        private static double[] selecaoFreq(double[] Sinal)
        {
            Complex[] sinalFFT = new Complex[janela];
            for (int i = 0; i < janela; i++)
            {
                sinalFFT[i] = new Complex(Sinal[i], 0);
            }

            // Converte tempo para frequência
            Fourier.Forward(sinalFFT, FourierOptions.NoScaling);


            double[] Sinal2 = new double[janela];
            Complex[] sinalFFT2 = new Complex[janela];

            for (int i = 1; i < janela / 10; i++)
            {
                double mag = (2.0 / janela) * (Math.Abs(Math.Sqrt(Math.Pow(sinalFFT[i].Real, 2) + Math.Pow(sinalFFT[i].Imaginary, 2))));
                //Determina quantos hertz
                double hzPeSample = freq / 3;

                if (mag > 0)
                {
                    if (hzPeSample * i == 60)
                    {
                        sinalFFT2[i] = sinalFFT[i];
                    }

                }
            }

            Fourier.Inverse(sinalFFT2, FourierOptions.NoScaling);

            for (int i = 0; i < janela; i++)
            {
                Sinal2[i] = (sinalFFT2[i].Real / (janela)) * 2;
            }

            return Sinal2;
        }

        private static double FatorPotencia(double[] vetorTensao, double[] vetorCorrente)
        {
            double Vrms = RMS(vetorTensao);
            double Irms = RMS(vetorCorrente);
            double Sap = Vrms * Irms;

            double Sat = 0;
            double resultado = 0;

            for (int i = 0; i < vetorTensao.Length; i++)
            {
                Sat = Sat + (vetorTensao[i] * vetorCorrente[i]);
            }
            resultado = (Sat/vetorCorrente.Length)/Sap;
            return resultado;
        }
 

