                this.Invoke(scb, new object[] { val });
                //textBox2.Text = val;
            }

            else
            {
                if (val.IndexOf("#") > 0)
                {
                    String myValue = val;
                    int fim = myValue.IndexOf("#") - 1;
                    myValue = myValue.Substring(1, fim);
                    if (trifasicoToolStripMenuItem.Checked)
                    {
                        entrada3 = myValue.Split(',');
                        stringtensaoA[i] = entrada3[0];
